import React from "react";
import "./Login.css";

const SERVER_URL = "https://localhost:8888/";

export default function Login() {
  return (
    <div className="login">

      <p>
        An insight into your listening habits on Spotify
      </p>
      <a href={SERVER_URL}> Login to Spotify </a>
    </div>
  );
}
